import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ComplaintForm from './components/ComplaintForm';
import Dashboard from './components/Dashboard';
import RewardSystem from './components/RewardSystem';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Bhrashtachar Mukt</h1>
          <p>AI-Powered Anti-Corruption System</p>
        </header>
        
        <nav className="App-nav">
          <a href="/">Submit Complaint</a>
          <a href="/dashboard">Dashboard</a>
          <a href="/rewards">Reward System</a>
        </nav>
        
        <main className="App-main">
          <Routes>
            <Route path="/" element={<ComplaintForm />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/rewards" element={<RewardSystem />} />
          </Routes>
        </main>
        
        <footer className="App-footer">
          <p>Hackathon MVP Demo | Not connected to real government systems</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
